      return 
    }
  }
  return (
    <div className="flex space-x-10 justify-center">
      <button className="bg-blue-200 px-3"><Link to="/" >New Proposal</Link></button>
      <button className="bg-blue-200 px-3"><Link to="/about">All Proposals</Link></button>
